import React from "react";

const TodoList = ({ todos, handleDelete }) => {
  return (
    <div>
      {todos.map((item, index) => (
        <div>
          <p key={index}>{item}</p>
          
        </div>
      ))}
    </div>
  );
};

export default TodoList;
